import React from 'react';
import Card from './Card';
import Sdata from './Sdata';
const Service =()=>{
  return(<>
  <div  className="my-4">
  
    <h1 className="tab-center">Services</h1>
    <hr className="w-25 mx-auto" />
  </div>
  
  {
    Sdata.map((val,index)=>{
      return <Card 
        image ={val.imgsrc}
        title={val.title}
      />
    })
  }
  
  </>);
}

export default Service;
